import React from "react";
import "../styles/Header.css";

export const Header = () => {
  return (
    <header className="header">
      <img
        src="./public/logo.png"
        alt="AceClean Experts"
        className="header-logo"
      />

<div className="logo">
        {/* Referencing the logo directly from the public folder */}
        <img src={`${process.env.PUBLIC_URL}/logo.png`} alt="AceClean Xperts Logo" />
      </div>
    </header>
  );
};
